import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { PieChart, Pie, Tooltip } from "recharts";

import "./superHome.css";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);
  const [data01, setData01] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch superuser data
    const superUserAuthenticated = localStorage.getItem("superUserAuthenticated");

    if (!superUserAuthenticated) {
      navigate("/superUser/login");
      return;
    }

    fetch("http://localhost:5000/superUserData", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
      },
      body: JSON.stringify({
        token: superUserAuthenticated,
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        if (data.status === "ok") {
          setData(data.data);
          setLoading(false);
          setData01([
            { name: "SuperUsers", value: 1 },
            { name: "Companies", value: data.data.companies.length },
            { name: "Users", value: data.data.users.length },
          ]);
        }
      });
  }, [navigate]);

  const deleteUser = (id, name) => {
    const confirmDelete = window.confirm(`Are you sure you want to delete ${name}`);
    if (confirmDelete) {
      fetch(`http://localhost:5000/deleteUser/${id}`, {
        method: "DELETE",
      })
        .then((response) => {
          if (response.status === 200) {
            // Refetch data after deletion
            fetchData();
          } else {
            console.error("Error deleting user:", response.statusText);
          }
        })
        .catch((error) => {
          console.error("Error deleting user:", error);
        });
    }
  };

  const deleteCompany = (id, name) => {
    const confirmDelete = window.confirm(`Are you sure you want to delete ${name}`);
    if (confirmDelete) {
      fetch(`http://localhost:5000/deleteCompany/${id}`, {
        method: "DELETE",
      })
        .then((response) => {
          if (response.status === 200) {
            // Refetch data after deletion
            fetchData();
          } else {
            console.error("Error deleting company:", response.statusText);
          }
        })
        .catch((error) => {
          console.error("Error deleting company:", error);
        });
    }
  };

  const logout = () => {
    window.localStorage.clear();
    navigate("/superUser/login");
  };

  const fetchData = () => {
    // Fetch data for the pie chart
    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        setData01([
          { name: "Users", value: data.data.users.length },
          { name: "Companies", value: data.data.companies.length },
        ]);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  };

  return (
    <div>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <h4>
            Hello {data.fname} {data.lname}
          </h4>
          {/* Display the superuser's data */}
          <table className="table table-striped table-bordered">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Email</th>
                <th>User Type</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {data.data.users.map((user) => (
                <tr key={user._id}>
                  <td>{user._id}</td>
                  <td>
                    {user.fname} {user.lname}
                  </td>
                  <td>{user.email}</td>
                  <td>{user.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteUser(user._id, `${user.fname} ${user.lname}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
              {data.data.companies.map((company) => (
                <tr key={company._id}>
                  <td>{company._id}</td>
                  <td>
                    {company.fname} {company.lname}
                  </td>
                  <td>{company.email}</td>
                  <td>{company.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteCompany(company._id, `${company.email}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          <p>TOTAL COMPANIES: {data.data.companies.length}</p>
          <p>TOTAL USERS: {data.data.users.length}</p>
          <p>
            TOTAL ACCOUNTS:{" "}
            {data.data.users.length + data.data.companies.length}
          </p>
          <button className="btn btn-primary" onClick={logout}>
            Logout
          </button>

          <PieChart width={1000} height={400}>
            <Pie
              data={data01}
              dataKey="value"
              nameKey="name"
              cx="50%"
              cy="50%"
              outerRadius={130}
              fill="#8884d8"
            />
            <Tooltip />
          </PieChart>
        </div>
      )}
    </div>
  );
}
